import React from "react";
import styled from "styled-components";

const AboutEC_Page = styled.div`
  height: 1084px;
  background-color: #f2f2f2;
`;

const AboutEcContainer = styled.div`
  max-width: 1280px;
  height: 100%;
  margin: 0 auto;
  padding-left: 40px;
  padding-right: 40px;
  box-sizing: border-box;
  display: grid;
  grid-template-columns: 131fr 135fr 319fr 314fr 215fr 86fr;
  grid-template-rows: 197fr 142fr 477fr 480fr;
  .AboutEcMain {
    grid-column: 3 / span 3;
    grid-row: 2 / span 1;
  }
  .AboutEcVideo {
    grid-column: 3 / span 3;
    grid-row: 3 / span 1;
    background-color: #dddddd;
  }
  .AboutEcContent div {
    grid-column: 3 / span 1;
    grid-row: 4 / -1;
  }
`;

function AboutEC() {
  return (
    <AboutEC_Page>
      <AboutEcContainer>
        <div className="AboutEcLeft">
          <span>AboutEC</span>
        </div>
        <div className="AboutEcMain">
          <span>Endless Creation</span> 은 사람과 컴퓨터를 사랑하는 동아리로,
          <br /> 개발하는 재미와 성장하는 즐거움을 알아갈 수 있는 다양한 활동을
          준비하고 있습니다.
        </div>
        <div className="AboutEcVideo"></div>
        <div className="AboutEcContent">
          <div className="AboutEcGrowth">1</div>
          <div className="AboutEcSharing">2</div>
          <div className="AboutEcCooperation">3</div>
        </div>
      </AboutEcContainer>
    </AboutEC_Page>
  );
}

export default AboutEC;
